import React from 'react'
import { HeaderSecretariaDC, ClienParticular, ClienCorporativo, ActualizarCliente } from '../../Components'
import Button from 'react-bootstrap/Button'
import Link from 'react-router-dom'
import Container from 'react-bootstrap/Container';

class Clientes extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            showComponent1: false,
            showComponent2: false,
            showComponent3: false
        };
        this._onButtonClick = this._onButtonClick.bind(this);
        this._onButtonClick2 = this._onButtonClick2.bind(this);
        this._onButtonClick3 = this._onButtonClick3.bind(this);
      }

        _onButtonClick3() {
            if (this.state.showComponent3) {
                this.setState({showComponent3: false});
            } else {
                this.setState({showComponent3: true,
                    showComponent2: false,
                    showComponent1: false,});
            }}

        _onButtonClick2() {
            if (this.state.showComponent2) {
                this.setState({showComponent2: false,
                    showComponent3: true,
                    showComponent1: false,});
            } else {
                this.setState({showComponent2: true});
            }}
      
      
      _onButtonClick() {
            if (this.state.showComponent1) {
            this.setState({showComponent1: false,
                showComponent2: false,
                showComponent3: false,});
            } else {
                this.setState({showComponent1: true});
        }}
        
    render(){
    return (
        <>
            <HeaderSecretariaDC />
            
            <Container className="mr-50 ml-50">
            <Button onClick={this._onButtonClick} variant="primary">Nuevo Cliente</Button>{this.state.showComponent1 ? <ClienParticular /> :null}
            <Button onClick={this._onButtonClick2} variant="primary">Nuevo Cliente Corporativo</Button>{this.state.showComponent2 ? <ClienCorporativo /> :null}
            <Button onClick={this._onButtonClick3} variant="primary">Actualizar Cliente</Button>{this.state.showComponent3 ? <ActualizarCliente /> :null}
            {/* <h2> Nuevo Cliente Particular </h2> */}
            {/* <ClienParticular /> */}
            {/* <h2> Nuevo Cliente Corporativo </h2> */}
            {/* <ClienCorporativo /> */}
            </Container>
        </>
    )
}}

export default Clientes
